// SPDX-License-Identifier: Unlicensed
pragma solidity >=0.5.0;
pragma experimental ABIEncoderV2;

import '../interfaces/IERC20.sol';
import "../open/utils/Initializable.sol";
import "../open/token/ERC721/IERC721.sol";
import "../open/token/ERC721/utils/ERC721Holder.sol";
import "../open/token/ERC1155/utils/ERC1155Holder.sol";
import "../open/token/ERC1155/IERC1155.sol";
import "../open/utils/Ownable.sol";
import "../open/lib/EnumerableSet.sol";



contract Nmarket is ERC721Holder,ERC1155Holder,Initializable,Ownable{

    using EnumerableSet for EnumerableSet.UintSet;
    //IERC721 public nToken;
    mapping(address => bool) supportSellNfts;

    mapping(address => bool) isNft721;

    IERC20 public payToken;

    /////////////////////////////////////////////////////////

    uint public ORDER_ID = 100000;

    struct Order{
        uint id;            //ID
        address seller;     //
        uint price;         //
        address nft;        //nft
        bool is721;         //721
        uint nftId;         //id
        uint amount;        //
        address buyer;      //
    }

    struct Market{
        EnumerableSet.UintSet networkIds;
        mapping(address => EnumerableSet.UintSet) userIds;
    }

    mapping(address => Market) marketMaps;

    mapping( uint => Order) public fixedOrderMap;  //

    uint public fixedOrderFee =  5;

    /////////////////////////////////////////////////////////

    constructor() public {}

    function initialize(
        address _payToken,
        address _ownerAddress
    ) public initializer {
        payToken = IERC20(_payToken);
        _owner = _ownerAddress;
        fixedOrderFee = 5;
        ORDER_ID = 10000;
    }

    function addSupportSellNft(address[] memory nft721s ,address[] memory nft1155s)external onlyOwner{

        for( uint i = 0; i < nft721s.length; i++){
            supportSellNfts[nft721s[i]] = true;
            isNft721[nft721s[i]] = true;
        }

        for( uint i = 0; i < nft1155s.length; i++){
            supportSellNfts[nft1155s[i]] = true;
            isNft721[nft1155s[i]] = false;
        }
    }

    //
    function userFixedOrders(address nft)external view returns(Order[] memory _orders){

        Market storage market = marketMaps[nft];

        uint len = market.userIds[msg.sender].length();

        _orders = new Order[](len);

        for( uint i = 0; i < len; i++){
            _orders[i] = fixedOrderMap[market.userIds[msg.sender].at(i)];
        }
    }

    //
    function fixedOrders(address nft,uint start,uint end)external view returns(
            Order[] memory _orders,uint count){

        Market storage market = marketMaps[nft];
        count = market.networkIds.length();

        if( count > 0){
            if( end > count ) end = count - 1;

            if( end >= start ){

                uint size = end - start + 1;

                _orders = new Order[](size);

                for( (uint i,uint k) = (start,0); i <= end && k < size; (i++,k ++) ){
                    _orders[k] = fixedOrderMap[market.networkIds.at(i)];
                }
            }
        } 
    }

    function setNft721(address nft,uint nftId,uint price)external{

        require(supportSellNfts[nft],"not support");

        require(isNft721[nft],"not 721");

        IERC721(nft).safeTransferFrom(msg.sender,address(this),nftId);

        _doSellNft(nft,nftId,price,1,true);
    }


    function _doSellNft(
            address nft,
            uint nftId,
            uint price,
            uint amount,
            bool is721)internal{

        Market storage market = marketMaps[nft];

        uint id = ORDER_ID;
        ORDER_ID ++;

        fixedOrderMap[id] = Order(
                id,
                msg.sender,
                price,
                nft,
                is721,
                nftId,
                amount,
                address(0));

        market.networkIds.add(id);
        market.userIds[msg.sender].add(id);
    }

    //
    function sellNft1155(address nft,uint nftId,uint price,uint amount)external{

        require(supportSellNfts[nft],"not support");

        require(!isNft721[nft],"not 1155");

        IERC1155(nft).safeTransferFrom(msg.sender, address(this), nftId, amount, "");

        _doSellNft(nft,nftId,price,amount,false);        
    }

    //
    function cancleFixedNft(uint orderId)external{

        Order storage order = fixedOrderMap[orderId];

        require(order.buyer == address(0),"buyed");

        require(order.seller == msg.sender,"not owner");

        address nft = order.nft;
        if( isNft721[nft]){
            IERC721(nft).safeTransferFrom(address(this),order.seller,order.nftId);
        }else{
            IERC1155(nft).safeTransferFrom(address(this),order.seller,order.nftId, order.amount, "");
        }

        Market storage market = marketMaps[nft];

        require(market.networkIds.remove(orderId),"not exist");

        require(market.userIds[order.seller].remove(orderId),"seller not exist");

        order.seller = address(0);
    }

    //
    function buyNft(uint orderId)external{

        Order storage order = fixedOrderMap[orderId];

        require(order.buyer == address(0),"buyed");

        require(order.seller != msg.sender,"onself");

        require(order.seller != address(0),"cancled");

        uint fee = order.price * fixedOrderFee / 100;
        uint v = order.price - fee;
        payToken.transferFrom(msg.sender, order.seller, v);

        order.buyer = msg.sender;

        address nft = order.nft;
        if( isNft721[nft]){
            IERC721(nft).safeTransferFrom(address(this),msg.sender,order.nftId);
        }else{
            IERC1155(nft).safeTransferFrom(address(this),msg.sender,order.nftId, order.amount, "");
        }

        Market storage market = marketMaps[order.nft];

        require(market.networkIds.remove(orderId),"not exist");

        require(market.userIds[order.seller].remove(orderId),"seller not exist");

    }

}
